import React, { Component } from "react";
import error from "../img/404.svg"
class NotFound extends Component {
  state = {};
  render() {
    return <div>
      <img src={error} alt=""/>
      <span>صفحه مورد نظر یافت نشد</span>
    </div>;
  }
}

export default NotFound;
